// css files
import './App.css';
import "../src/css/rsmenu-main.css";
import "../src/img/logo.svg";
import "../src/Styles.css";
import '../src/Rsspacing.css';
import '../src/css/responsive.css';
import '../src/css/animate.css';
// import '../src/css/font-awesome.min.css';
import '../src/css/magnific-popup.css';
import '../src/css/off-canvas.css';
import '../src/css/owl.carousel.css';
import '../src/css/slick.css';
// Js files
import '../src/js/jquery.nav.js';
import '../src/js/jquery.counterup.min.js';
import '../src/js/jquery.magnific.popup.min.js';
import '../src/js/jquery.min.js';
import '../src/js/main.js';
import '../src/js/modernizr-2.8.3.min.js';
import '../src/js/owl.carousel.min.js';
import '../src/js/particles.min.js';
import '../src/js/plugins.js';
import '../src/js/pointer.js';
import '../src/js/rsmenu-main.js';
import '../src/js/skill.bars.jquery.js';


import Header from './Components/Header';
import Barnner from './Components/Barnner';
import Services from './Components/Services';
import About from './Components/About';
import Counter from './Components/Counter';
import Product from './Components/Product';
import Testimonial from './Components/Testimonial';
import Start from './Components/Start';
import Footer from './Components/Footer';


function App() {
  return (

    <div className="App">
      <Header />
      <Barnner/>
      <Services/>
      <About/>
      <Counter/>
      <Product/>
      <Testimonial/>
      <Start/>
      <Footer/>
    </div>
  );
}

export default App;
